import React, { useState } from "react";
import Navbar from "./components/Navbar";
import StockScanner from "./components/StockScanner";
import "./App.css";

const App = () => {
  const [tickers, setTickers] = useState([]);

  return (
    <>
      <Navbar />
      <div className="app-layout">
        {/* Search Bar */}
        <div className="search-bar">
          <StockScanner onTickersChange={setTickers} />
        </div>

        {/* Stock Results Section */}
        <div className="stock-results">
          <h2>Stock Results</h2>
        </div>

        {/* Main Content */}
        <div className="main-content">
          {/* Stock List */}
          <div className="stock-list">
            {tickers.map((ticker, index) => (
              <div className="stock-card" key={index}>
                <h3>{ticker}</h3>
                <p>Sample data for {ticker}</p>
              </div>
            ))}
          </div>

          {/* News Widget */}
          <div className="news-widget">
            <h4>Latest Stock News</h4>
            {tickers.map((ticker, index) => (
              <div key={index} className="news-section">
                <h5>{ticker}</h5>
                <p>No news available for {ticker}.</p>
              </div>
            ))}
          </div>
        </div>
      </div>
    </>
  );
};

export default App;
